const rigidBody = this.getComponent('Rigidbody');
const animation = this.getComponent('Animation');

onEnterFrame = () => {
	const speed = rigidBody.speed;

	if(speed < 0.1) {
		animation.play('Idle', {wrapMode: 'loop'});
		animation.stop('Run');
	}else{
		animation.play('Run', {wrapMode: 'loop'});
		animation.stop('Idle');
	}
}
